graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Product Catalog</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "BrowseProducts" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>BrowseProducts</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Browse Products</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "SearchProducts" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>SearchProducts</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Search Products</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ViewProduct" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ViewProduct</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">View Product Details</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "CompareProducts" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CompareProducts</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Compare Products</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "AddToWishlist" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>AddToWishlist</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Add to Wishlist</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "BrowseProducts" -> "ViewProduct" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "SearchProducts" -> "ViewProduct" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ViewProduct" -> "CompareProducts" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ViewProduct" -> "AddToWishlist" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
